char GetIsTimeInRange(int hourA, int hourB)
{
    if (hourA > hourB)
    {
        if (CurrentTimeHours() >= hourA || CurrentTimeHours() < hourB)
            return 1;
    }
    else if (CurrentTimeHours() >= hourA && CurrentTimeHours() < hourB)
    {
        return 1;
    }
    return 0;
}

